import React, { Component } from 'react';
import { Link } from 'react-router-dom';

export default class Navbar extends Component {
    render(){
        return (
            <div>
                <ul>
                    <Link to="/users" >Users</Link>
                    <Link to="/users"> Create User</Link>
                </ul>
            </div>
        );
    }
}
